CREATE DEFINER=`root`@`localhost` PROCEDURE `MasVendidos`()
BEGIN
SELECT 
    cc.CursoPagado, 
    COUNT(cc.IdCursoComp) AS Repeticiones,
    c.IdCUrso,
    c.Nombre, 
    c.Descripcion, 
    c.Costo
FROM 
    cursocomprado cc
JOIN 
    cursos c ON cc.CursoPagado = c.IdCurso
GROUP BY 
    cc.IdCursoComp, c.Nombre, c.Descripcion, c.Costo
ORDER BY 
    Repeticiones DESC
LIMIT 3;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `MasCalificados`()
BEGIN
SELECT 
    IdCurso, 
    Nombre, 
    Descripcion, 
    Costo, 
    Calificacion
FROM 
    cursos
WHERE 
    Calificacion >= 9
ORDER BY 
    Calificacion DESC
LIMIT 3;

END$$

