CREATE DEFINER=`root`@`localhost` PROCEDURE `Busqueda` (IN `p_Busqueda` VARCHAR(255), IN `p_TipoBusqueda` INT, IN `p_Categorias` VARCHAR(255), IN `p_FechaMin` DATE, IN `p_FechaMax` DATE)   BEGIN
    DECLARE palabras_busqueda VARCHAR(255);
    DECLARE categorias_filtro VARCHAR(255);

    -- Normalizar las palabras de búsqueda y categorías
    SET palabras_busqueda = REPLACE(REPLACE(TRIM(p_Busqueda), ',', ' '), '  ', ' ');

    SELECT DISTINCT
        IdCurso,
        Instructor,
        NombreCurso,
        UsuarioInstructor,
        InstructorNombres,
        InstructorApllds,
        IdCategoria,
        NombreCategoria,
        Descripcion,
        Foto,
        Extension,
        Costo,
        FechaCreacion,
        NumNivel,
        Nombre,
        Video,
        Recurso,
        TipoRecurso,
        PrecioIndividual,
        Estado
    FROM
        ViewCursos
         WHERE
        -- Condición de búsqueda dependiendo del tipo
        (palabras_busqueda IS NULL OR palabras_busqueda = ''
        OR (p_TipoBusqueda = 1 AND NombreCurso LIKE CONCAT('%', palabras_busqueda, '%'))
        OR (p_TipoBusqueda = 2 AND UsuarioInstructor LIKE CONCAT('%', palabras_busqueda, '%')))
        
        -- Condición de categorías
        AND (p_Categorias IS NULL OR p_Categorias = '' 
        OR FIND_IN_SET(IdCategoria, p_Categorias))

        -- Condiciones de rango de fechas
        AND (p_FechaMin IS NULL OR FechaCreacion >= p_FechaMin)
        AND (p_FechaMax IS NULL OR FechaCreacion <= p_FechaMax)
    ORDER BY 
        IdCurso, NumNivel;
END$$

