CREATE DEFINER=`` PROCEDURE `GetInfoCurso` (IN `p_IdCurso` INT)   BEGIN
    -- Seleccionar información del curso junto con el nombre del instructor
    SELECT c.IdCurso, c.Nombre, c.Descripcion, c.Calificacion, c.Foto, c.Extension, c.Costo, c.FechaCreacion, u.NomUsuario AS NombreInstructor, 
    u.Foto AS Fotoinstructor, u.Extension AS ExtensionInstructor
    FROM cursos c
    JOIN usuario u ON c.Instructor = u.IdUsuario
    WHERE c.IdCurso = p_IdCurso;

    -- Seleccionar niveles asociados al curso y contar cuántos hay
    SELECT COUNT(IdNivel) AS TotalNiveles
    FROM nivel
    WHERE IdCurso = p_IdCurso;
    
    SELECT IdNivel, NumNivel, Nombre AS NombreNivel, PrecioIndividual
    FROM nivel
    WHERE IdCurso = p_IdCurso;
END$$

